create table benefit_plan_map (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
code varchar(30) not null, 
description varchar(1024) not null, 
end_date date, 
sync bit, 
pay_rate double precision, 
source_id bigint, 
source_type varchar(255), 
start_date date, 
primary key (id));

create table event (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(30) not null, 
code varchar(30) not null, 
description varchar(1024), 
end_date datetime2, 
is_active bit, 
sync bit, 
notes varchar(255), 
organizer varchar(255), 
start_date datetime2, 
status varchar(255), 
title varchar(255), 
type varchar(255), 
primary key (id));

create table geo_codes (
id bigint not null, 
city varchar(255), 
county varchar(255), 
geo_code varchar(255), 
state varchar(255), 
state_code varchar(255), 
zip_code varchar(255), 
primary key (id));

create table lookup_type (
id bigint not null, 
is_active BIT  default 'TRUE', 
module varchar(255), 
name varchar(255) not null, 
primary key (id));

create table lookup_values (
id int not null, 
description varchar(255), 
seq_number int, 
value varchar(255), 
type_id bigint, 
primary key (id));

create table position (id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(30) not null, 
code varchar(30), 
description varchar(1024), 
is_active bit, 
sync bit, 
title varchar(255) not null, 
primary key (id));

create table states (
id bigint not null, 
code varchar(30), 
country varchar(255), 
name varchar(255), 
primary key (id));

alter table event add constraint UKifhxrm0ecltohk7lh118ot8lu unique (client_code, code, type);

alter table position add constraint UK524kilf1eqry6kw39v67y0m9l unique (client_code, title);

create sequence benefit_plan_map_id_seq start with 1 increment by 1;

create sequence event_id_seq start with 1 increment by 1;

create sequence hibernate_sequence start with 1 increment by 1;

create sequence position_id_seq start with 1 increment by 1;

create sequence state_id_seq start with 1 increment by 1;

alter table lookup_values add constraint FKsvfoxc1qc6vdqj9epguf2cfkt foreign key (type_id) references lookup_type;

